import React from 'react';

import MenuItem from '../menu-item/menu-item.component';

import '../directory/directory.styles.scss';


class Directory extends React.Component{
    constructor(){
        super();

        this.state ={
          sections : [{
            title: 'hats',
            imageUrl: 'https://upload.wikimedia.org/wikipedia/commons/3/3a/Cat03.jpg',
            id: 1,
            linkUrl: 'shop/hats'
          },
          {
            title: 'jackets',
            imageUrl: 'https://upload.wikimedia.org/wikipedia/commons/4/41/Sunflower_from_Silesia2.jpg',
            id: 2,
            linkUrl: 'shop/jackets'
          },
          {
            title: 'sneakers',
            imageUrl: 'https://commons.wikimedia.org/wiki/Special:NewFiles#/media/File:112_Saint_Pardoux_(63440).jpg',
            id: 3,
            linkUrl: 'shop/sneakers'
          },
          {
            title: 'womens',
            imageUrl: 'https://i.ibb.co/GCCdy8t/womens.png',
            size: 'large',
            id: 4,
            linkUrl: 'shop/womens'
          },
          {
            title: 'mens',
            imageUrl: 'https://i.ibb.co/R70vBrQ/men.png',
            size: 'large',
            id: 5,
            linkUrl: 'shop/mens'
          }
        ]   
        }
    }

    render(){
        return(
            <div className='directory-menu'>
                {
                    this.state.sections.map(({title,imageUrl, id}) =>(
                        <MenuItem key={id} title={title} imageUrl ={imageUrl}/>
                        )
                    )
                }
            </div>
        )
    }
}

export default Directory;
